--

CREATE FUNCTION public.calculate_cagr(beginning_value numeric, ending_value numeric, years integer) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
BEGIN
    RETURN (POWER((ending_value / beginning_value), (1.0 / years)) - 1);
END;
$$;


