CREATE FUNCTION public.calculate_mean(arr numeric[]) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
    mean NUMERIC;
BEGIN
    -- Calculate the mean
     
	mean := (SELECT AVG(val) FROM unnest(arr) AS val WHERE val <> 0);

    RETURN mean;
END;
$$;


ALTER FUNCTION public.calculate_mean(arr numeric[]) OWNER TO postgres;

--
