-- Name: calculate_median(numeric[]); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.calculate_median(arr numeric[]) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
    sorted_arr numeric[];
    arr_len int;
    middle int;
    median numeric;
BEGIN
    -- Sort the array
    sorted_arr := ARRAY(
        SELECT val FROM unnest(arr) AS val WHERE val <> 0 ORDER BY val
    );

    -- Get the length of the array
    arr_len := array_length(sorted_arr, 1);

    -- Calculate the middle index
    middle := arr_len / 2;

    -- If the array has an even number of elements, take the average of the two middle values
    IF arr_len % 2 = 0 THEN
        median := (sorted_arr[middle] + sorted_arr[middle + 1]) / 2;
    ELSE
        -- If the array has an odd number of elements, take the middle value
        median := sorted_arr[middle + 1];
    END IF;

    RETURN median;
END;
$$;


