--
-- TOC entry 277 (class 1255 OID 122299)
-- Name: calculate_stddev(numeric[]); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.calculate_stddev(arr numeric[]) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
    n INT;
    mean NUMERIC;
    variance NUMERIC;
    stddev NUMERIC;
BEGIN
    -- Calculate the number of elements
    n := (SELECT COUNT(val) FROM unnest(arr) AS val WHERE val <> 0);

    -- Calculate the mean
    mean := (SELECT AVG(val) FROM unnest(arr) AS val WHERE val <> 0);

    -- Calculate the variance
    variance := (SELECT AVG((val - mean) ^ 2) FROM unnest(arr) AS val WHERE val <> 0);

    -- Calculate the standard deviation
    stddev := sqrt(variance);

    RETURN stddev;
END;
$$;


ALTER FUNCTION public.calculate_stddev(arr numeric[]) OWNER TO postgres;

--
-- TOC entry 264 (class 1255 OID 122301)
-- Name: calculate_variance_coefficient(numeric[]); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.calculate_variance_coefficient(arr numeric[]) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
    mean NUMERIC;
    stddev NUMERIC;
    cv NUMERIC;
BEGIN
    -- Calculate the mean
    mean := calculate_mean(arr);

    -- Calculate the standard deviation
    stddev := calculate_stddev(arr);

    -- Calculate the Variance Coefficient (Coefficient of Variation)
    IF mean <> 0 THEN
        cv := stddev / mean;
    ELSE
        cv := NULL;
    END IF;

    RETURN cv;
END;
$$;


