ALTER PROCEDURE public.sector_update_descriptive_statistics_indicators() OWNER TO postgres;

--
-- TOC entry 263 (class 1255 OID 122327)
-- Name: update_descriptive_statistics_indicators(); Type: PROCEDURE; Schema: public; Owner: postgres
--

CREATE PROCEDURE public.update_descriptive_statistics_indicators()
    LANGUAGE plpgsql
    AS $$
DECLARE
    current_year INTEGER;
    start_year INTEGER;
    latest_year INTEGER;
	days INTEGER;
    tik VARCHAR(10);
	SQL1 numeric;
	SQL2 numeric;

BEGIN
	-- Iterate over each ticker in the income_statement table
    FOR tik IN SELECT DISTINCT ticker FROM income_statement LOOP
    		-- Determine the latest available year
		SELECT INTO latest_year
        CASE
            WHEN EXISTS (SELECT 1 FROM income_statement WHERE LEFT(fiscal_date_ending, 4)::INTEGER = EXTRACT(YEAR FROM CURRENT_DATE) AND ticker = tik)
            THEN EXTRACT(YEAR FROM CURRENT_DATE)
            ELSE EXTRACT(YEAR FROM CURRENT_DATE) - 1
        END;
		
		SELECT CASE 
            WHEN (SELECT count(*) FROM keyfinancialindicators WHERE ticker = tik) >= 10 
            THEN 9 
            ELSE (SELECT count(*) FROM keyfinancialindicators WHERE ticker = tik)::INTEGER - 1
        END
        INTO days;

        -- Calculate the start year as 10 years before the latest year
        start_year := latest_year - days;
		RAISE NOTICE 'Variable TICKER value: %',tik;
		RAISE NOTICE 'Variable latest_year value: %', latest_year;
		RAISE NOTICE 'Variable start_year value: %', start_year;
		RAISE NOTICE 'Variable days value: %', days;
		SELECT (SELECT total_revenue FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = start_year AND ticker =tik) INTO SQL1;
		RAISE NOTICE 'Variable SQL1 value: %', SQL1;
		select calculate_cagr(
				(SELECT total_revenue FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = start_year AND ticker = tik),
				(SELECT total_revenue FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = latest_year AND ticker =tik),
				days
			) into sql2;
	   	RAISE NOTICE 'Variable SQL2 value: %', SQL2;
	


    -- Execute the query to calculate the necessary values
		WITH calculated_values AS (
			SELECT
					t1.ticker,
					start_year as test,
					calculate_cagr(
				(SELECT total_revenue FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = start_year AND ticker = t1.ticker),
				(SELECT total_revenue FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = latest_year AND ticker = t1.ticker),
				days
			) AS cagr_revenue,
			CASE WHEN (SELECT gross_profit FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = start_year AND ticker = t1.ticker) <= 0 
				 OR (SELECT gross_profit FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = latest_year AND ticker = t1.ticker) <= 0
				 THEN 0
				 ELSE calculate_cagr(
				(SELECT gross_profit FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = start_year AND ticker = t1.ticker),
				(SELECT gross_profit FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = latest_year AND ticker = t1.ticker),
				days) 
				END AS cagr_gross_profit,
			/*calculate_cagr(
				(SELECT ebitda FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = start_year AND ticker = t1.ticker),
				(SELECT ebitda FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = latest_year AND ticker = t1.ticker),
				days
			) AS cagr_ebitda,
			calculate_cagr(
				(SELECT net_income FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = start_year AND ticker = t1.ticker),
				(SELECT net_income FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = latest_year AND ticker = t1.ticker),
				days
			) AS cagr_net_income,*/
			CASE WHEN (SELECT operating_income FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = start_year AND ticker = t1.ticker) <= 0 
				 OR (SELECT operating_income FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = latest_year AND ticker = t1.ticker) <= 0
				 THEN 0
				 ELSE calculate_cagr(
				(SELECT operating_income FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = start_year AND ticker = t1.ticker),
				(SELECT operating_income FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = latest_year AND ticker = t1.ticker),
				days
			) END AS cagr_operating_income,
			calculate_cagr(
				(SELECT total_assets FROM balance_sheet WHERE left(fiscal_date_ending,4)::INTEGER = start_year AND ticker = t1.ticker),
				(SELECT total_assets FROM balance_sheet WHERE left(fiscal_date_ending,4)::INTEGER = latest_year AND ticker = t1.ticker),
				days
			) AS cagr_total_assets,
			calculate_cagr(
				(SELECT total_liabilities FROM balance_sheet WHERE left(fiscal_date_ending,4)::INTEGER = start_year AND ticker = t1.ticker),
				(SELECT total_liabilities FROM balance_sheet WHERE left(fiscal_date_ending,4)::INTEGER = latest_year AND ticker = t1.ticker),
				days
			) AS cagr_total_liabilities,
			calculate_cagr(
				(SELECT cost_of_revenue FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = start_year AND ticker = t1.ticker),
				(SELECT cost_of_revenue FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = latest_year AND ticker = t1.ticker),
				days
			) AS cagr_cost_of_revenue,
			calculate_cagr(
				(SELECT selling_general_and_administrative FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = start_year AND ticker = t1.ticker),
				(SELECT selling_general_and_administrative FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = latest_year AND ticker = t1.ticker),
				days
			) AS cagr_selling_general_and_administrative,
			CASE WHEN (SELECT research_and_development FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = start_year AND ticker = t1.ticker) <= 0
				 OR (SELECT research_and_development FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = latest_year AND ticker = t1.ticker) <= 0
				 THEN 0 
			     ELSE calculate_cagr(
				(SELECT research_and_development FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = start_year AND ticker = t1.ticker),
				(SELECT research_and_development FROM income_statement WHERE left(fiscal_date_ending,4)::INTEGER = latest_year AND ticker = t1.ticker),
				days
			) END AS cagr_research_and_development,
			calculate_variance_coefficient((SELECT ARRAY_AGG(net_profit_margin::NUMERIC) from keyfinancialindicators where ticker = t1.ticker and left(fiscal_date_ending,4)::INTEGER between start_year and latest_year)) as cv_net_profit_margin,
			calculate_variance_coefficient((SELECT ARRAY_AGG(sga_gross_profit_margin::NUMERIC) from keyfinancialindicators where ticker = t1.ticker and left(fiscal_date_ending,4)::INTEGER between start_year and latest_year)) as cv_sga_gross_profit_margin,  
			calculate_variance_coefficient((SELECT ARRAY_AGG(rnd_gross_profit_margin::NUMERIC) from keyfinancialindicators where ticker = t1.ticker and left(fiscal_date_ending,4)::INTEGER between start_year and latest_year)) as cv_rnd_gross_profit_margin,  
			calculate_variance_coefficient((SELECT ARRAY_AGG(depreciation_gross_profit_margin::NUMERIC) from keyfinancialindicators where ticker = t1.ticker and left(fiscal_date_ending,4)::INTEGER between start_year and latest_year)) as cv_depreciation_gross_profit_margin,
			calculate_variance_coefficient((SELECT ARRAY_AGG(inteexp_operating_income_margin::NUMERIC) from keyfinancialindicators where ticker = t1.ticker and left(fiscal_date_ending,4)::INTEGER between start_year and latest_year)) as cv_inteexp_operating_income_margin,
			calculate_variance_coefficient((SELECT ARRAY_AGG(ebitda_revenue_margin::NUMERIC) from keyfinancialindicators where ticker = t1.ticker and left(fiscal_date_ending,4)::INTEGER between start_year and latest_year)) as cv_ebitda_revenue_margin,
			calculate_variance_coefficient((SELECT ARRAY_AGG(cr_revenue_margin::NUMERIC) from keyfinancialindicators where ticker = t1.ticker and left(fiscal_date_ending,4)::INTEGER between start_year and latest_year)) as cv_cr_revenue_margin,
