--
-- TOC entry 281 (class 1255 OID 130557)
-- Name: update_stock_prices_adjusted(); Type: PROCEDURE; Schema: public; Owner: postgres
--

CREATE PROCEDURE public.update_stock_prices_adjusted()
    LANGUAGE plpgsql
    AS $$ 

DECLARE

tik VARCHAR(10);
BEGIN
FOR tik IN (SELECT DISTINCT symbol FROM company_overview) LOOP

WITH ranked_splits AS (
    SELECT 
        t5.ticker AS ticker,
        t5.trade_date AS trade_date,
        t5.price AS price,
        t6.ticker AS ticker_2,
        t6.effective_date AS effective_date,
		(select count(*) from stock_splits where trade_date >= effective_date AND effective_date>'1999-12-31' and ticker=t5.ticker) as countin,
		(select sum(split_factor) from stock_splits where trade_date >= effective_date and ticker=t5.ticker) sum_splitfactor,
		(select sum(split_factor) from stock_splits where trade_date <= effective_date and ticker=t5.ticker) sum_splitfactor_desc,	
		t5.price * (select sum(split_factor) from stock_splits where trade_date >= effective_date and ticker=t5.ticker) as adjusted_price,
	    t5.price / (select sum(split_factor) from stock_splits where trade_date <= effective_date and ticker=t5.ticker) as adjusted_price_div,	
        case when t6.split_factor is null then 1 else t6.split_factor end AS split_factor,
        ROW_NUMBER() OVER (
            PARTITION BY t5.trade_date 
            ORDER BY t6.effective_date DESC
        ) AS rn
    FROM 
        stock_prices t5
   LEFT JOIN 
        stock_splits t6 
    ON 
        t5.ticker = t6.ticker and
		t5.trade_date >= t6.effective_date
    WHERE 
        t5.ticker = tik
)
SELECT 
    ticker, 
    trade_date, 
   	case when COALESCE(sum_splitfactor_desc, 0)=0 then price else adjusted_price_div end	
FROM 
    ranked_splits
WHERE 
    rn = 1
ORDER BY 
    trade_date ASC
ON CONFLICT (ticker, trade_date)
        DO UPDATE SET 
            price_adjusted = EXCLUDED.price_adjusted;
END LOOP;
END;
$$;


ALTER PROCEDURE public.update_stock_prices_adjusted() OWNER TO postgres;

--
-- TOC entry 280 (class 1255 OID 130498)
-- Name: update_yoy(); Type: PROCEDURE; Schema: public; Owner: postgres
--

CREATE PROCEDURE public.update_yoy()
    LANGUAGE sql
    AS $_$DO $$
DECLARE
    tik VARCHAR;
BEGIN
    FOR tik IN (SELECT DISTINCT symbol FROM company_overview) LOOP
        
        WITH calculated_values AS (
            SELECT 
                t1.ticker as ticker, 
                t1.net_income as net_income, 
                t2.common_stock_shares_outstanding as common_stock_shares_outstanding, 
                t1.fiscal_date_ending as fiscal_date_ending,
                LAG(t1.net_income) OVER (PARTITION BY t1.ticker ORDER BY t1.fiscal_date_ending) AS previous_net_income,
                ((t1.net_income - LAG(t1.net_income::float) OVER (PARTITION BY t1.ticker ORDER BY t1.fiscal_date_ending)) 
                 / LAG(t1.net_income::float) OVER (PARTITION BY t1.ticker ORDER BY t1.fiscal_date_ending)) AS yoy_percentage_change,
                ROW_NUMBER() OVER (PARTITION BY t1.ticker, t1.fiscal_date_ending ORDER BY t1.fiscal_date_ending) as row_num
            FROM 
                income_statement t1
            JOIN 
                balance_sheet t2 
            ON 
                t2.ticker = t1.ticker AND t2.fiscal_date_ending = t1.fiscal_date_ending
            WHERE 
                t1.ticker = tik
        )
            ticker, 
            net_income, 
            common_stock_shares_outstanding, 
            fiscal_date_ending,
            previous_net_income,
            yoy_percentage_change
        )
        SELECT
            ticker, 
            net_income, 
            common_stock_shares_outstanding, 
            fiscal_date_ending,
            previous_net_income,
            yoy_percentage_change
        FROM
            calculated_values
        WHERE row_num = 1
        ON CONFLICT (ticker, fiscal_date_ending)
        DO UPDATE SET 
            yoy_percentage_change = EXCLUDED.yoy_percentage_change,
            previous_net_income = EXCLUDED.previous_net_income,
            common_stock_shares_outstanding = EXCLUDED.common_stock_shares_outstanding,
            net_income = EXCLUDED.net_income;
    END LOOP;
END $$;$_$;


